import { Grid } from "@material-ui/core";
import React from "react";
import "./scss/cinemaDetail.css";

function CinemaDetailComponent() {


  return (
    <section className="cinemaDetail">
      <div className="infoPhim">
        <div className="background"></div>
        <div className="intro"></div>
      </div>
      <div>
        <Grid container className="infoCinema">
          <Grid item lb={4} className="rowOne">

          </Grid>
          <Grid item lb={8} className="rowTwo"></Grid>
        </Grid>
      </div>
    </section>
  );
}

export default CinemaDetailComponent;
